import React from 'react'
import * as S from './styles'

const NavigationMenu = () => {
  return (
    <S.NavigationMenu>
        <S.MenuItem>
            <S.IconWrapper/>
            <S.Title></S.Title>
        </S.MenuItem>
    </S.NavigationMenu>
  )
}

export {NavigationMenu}
